;a:1:{s:7:"caption";s:1453:"Bir kez daha olabilir
Bir kez daha gökyüzünün kapıları sana açılabilir
Aynı bahçeye yıldırım bir kez daha düşebilir 
Bir kez daha bir gülüşe bir şiir yazılabilir
Sevebilir insan
Ki sevince tüm ölülerini mezardan çıkarabilir
Halının altına süpürülür bir sürü dert
İnsan kahvede, fabrikada ya da ordan oraya koştururken
İyimser bir aşk şiiri mırıldanabilir
Açılmaz kapılar açılır
Gönüldeki kabuklar yırtılır
Kalem ele alınır

Bu lanet dünyanın göğsüne birkaç sevda sözcüğü sıkılabilir
Ömür belli bir noktada tıkanabilir bir süre
Sevilenin gözlerinde
Eylül bir kavuşma ayına dönüşebilir 
Gece dert dağlarının karargahı olmaktan çıkar 
En büyük hayallerin payitahtı oluverir
Yeniden dünyanın güzel olduğuna dair bir yanılgı oluşur 
Kapanır isyankar dudaklar bir süreliğine 
Gökyüzüyle iyi geçinmenin vakti gelmiş demektir

 Hayat okunan narin bir şiirdir yeniden 

 Tekrar ölüm yokmuş gibi yaşanılabilir

Ve dahî  insan tüm bu koşturmanın içinde tekrar eve dönebilir

[TAN]

